                // double theta = acos(1.0- 2.0*R1);
                // double phi = 2*M_PI*R2;
                double cos_khi = (2.0 + E_0 - 2.0*pow((1+E_0), R1))/E_0;
                if (cos_khi >= 1)
                    cos_khi = 1.0 - dopant;
                if (cos_khi <= -1)
                    cos_khi = -1.0 + dopant;
                                     
                double sin_khi = sqrt(1.0 - cos_khi*cos_khi);
 
                double phi = 2.0*M_PI*R2;
