                if (e.energy < delta_E) {
                    null_coll_counter++;
                    collision_counter_en++;
                    e.collided_en = true;
                    continue;
                }     
                else {                           
                    e.energy = E_0 - delta_E;
                }
                
 
                double speed = sqrt(2*e.energy*q/m_e);
 
                e.vx = speed*i_scat;
                e.vy = speed*j_scat;
                e.vz = speed*k_scat;              
 
                collision_counter_en++;
                el_coll_counter++;
 
                e.collided_en = true;
            }        

            else if (r < P1) {

